import React, { Component } from 'react';
import './App.css';

import Home from './components/Home';
import Alarm from './components/alarm/Alarm';

class App extends Component {
  render() {
    return (
      <div>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        <Alarm />
      </div>
    );
  }
}

export default App;
